						// Study Funzione In-Sample Out-Sample QTA //
						// Creare Uno Study //

// Vedi Screenshot In Cartella ...

// Attivare il commentary su tradestaton: View / Application Toolbars / Customize / Toolbars E attivare Charting-Tools-Classic
