int juego(char palabra[])
{
    Pila pila;
    inicpila(&pila);
    Pila aux;
    inicpila(&aux);
    int i=0, pilaCont=0;
    char actual[6]= {"-----"};
    char intentos[6][6];
    strcpy(intentos[i], "-----");
    char f1nal[6]= {"-----"};

    do
    {
        for(int j=0; j<i+1; j++)
        {
            printf("\nPalabra: %s",intentos[j]);
        }
        //
        printf("\nPalabra original: %s",palabra);
        printf("\nIntento actual (%i de 6): ", i+1);
        fflush(stdin);
        gets(&actual);
        //
        compararPalabras(actual,palabra);
        //
        for (int j=0; j<6; j++)
        {
            if (actual[j]==palabra[j])
            {
                //las letras coinciden, se mantienen en la comparación
                f1nal[j]= actual[j];
            }
        }
        //
        apilar(&pila, 1);
        i++;

        strcpy(intentos[i], f1nal);

        if(strcmpi(palabra,intentos[i]) == 0)
        {
            printf("\nPalabra acertada!!!: %s",intentos[i]);
        }
        if(strcmpi(palabra,intentos[i]) != 0)
        {
            printf("\n---------------------------*---------------------------\n");
        }

    }
    while(i<6 && strcmpi(palabra,intentos[i]) != 0);

    while(!pilavacia(&pila))
    {
        apilar(&aux, desapilar(&pila));
        pilaCont++;

    }
    return pilaCont;

}

void compararPalabras(char comparacion[], char original[])
{
    int i;
    int validos= strlen(original);

    for (i=0; i<validos; i++)
    {
        if (original[i]==comparacion[i])
        {
            //las letras coinciden, se mantienen en la comparación
            comparacion[i]= original[i];
        }
        else
        {
            //las letras no coinciden, se reemplazan por un guion bajo
            comparacion[i]= '-';
        }
    }
}

