int retornarCantidadRegistros(char name[])
{
    char palabra[6];
    int cantidad;
    FILE *archivo;
    archivo=fopen(name,"rb");
    if(archivo!=NULL)
    {
        fseek(archivo,0,SEEK_END);
        cantidad=ftell(archivo)/sizeof(palabra);
        fclose(archivo);
    }
    return cantidad;
}

