int check_dim(int r_mat, int l_mat, int i, int j)
{
    printf("\nr_mat:%d l_mat:%d i:%d j:%d\n", r_mat, l_mat, i, j);
    
    if (i < r_mat-2 && j < l_mat-1)
    {
        printf("Caso 0");
        return 0;
    }

    if (i == r_mat-2 && j < l_mat-1)
    {
        printf("Caso 1");
        return 1;
    }

    if (i == r_mat-2 && j == l_mat-1)
    {
        printf("Caso 2");
        return 2; 
    }

    printf("Nessun caso\n");
    return 3;
}


void stampatesto(char path[], int r_mat, int l_mat, int mat[r_mat][l_mat]) {
    printf("\n");
    
    FILE *fd;
    char c = ' ';
    char parola[34];
    int k = 0;

    int i = 0; //indice di riga
    int j = 0; //indice di colonna

    int res = check_dim(r_mat, l_mat, i, j);
    
    return;

    fd = fopen(path, "rt"); // apro il file di testo

    while(c != EOF) // finche' non incontro la terminazione del file
    { 
        c = fgetc(fd); // estraggo il carattere
        // se il carattere successivo è un terminatore '\n' 
            //controllo posizione nella dimensione della matrice
            //se non sono nell'ultima colonna e non sono nell'ultima riga cod:0
                //scrivo una linea vuota di dimensione l_col nella matrice
            //altrimenti
                //se sono nell'ultima riga ma non sono nell'ultima colonna cod:1
                    //mi posiziono alla colonna successiva
                //altrimenti
                    //se sono nell'ultima riga e nell'ultima colonna cod:2
                        //inserisco nella riga r_mat+1 il carattere speciale
                        // scrivo l'output sul file
                        // inizializzo la matrice
                        // inizializzo i puntatori
        // altrimenti
            if (isspace(c)) // controllo se il carattere è uno spazio
            { 
                parola[k] = '\0';  // aggiungi il terminatore di stringa
                printf("%s\n", parola); // stampo la parola fino a terminatore
                // se la dimensione della parola + la riga di appoggio è maggiore della
                // dimensione della colonna
                    // giustifico la riga di appoggio
                    // scrivo la riga di appoggio nella matrice
                    // inserisco nella matrice i caratteri di spaziatura tra colonne
                    // pulisco riga di appoggio
                    // inserisco parola in riga di appoggio
                // altrimenti se la dim della parola è < della dimensione della colonna
                    // inserisco la parola nella riga di appoggio
                
                k = 0; // inizializzo l'indice
                
            } 
            else 
            {
                if (c != EOF) // se c non è il terminatore del file
                { 
                    parola[k] = c; // aggiungo carattere a parola di appoggio
                    k++; // incremento l'indice
                }
            }
    
            /*if(c == EOF) // se sono al termine del file
            { 
                parola[k] = '\0'; // aggiungo il terminatore di stringa
                printf("%s\n", parola); // stampo la parola
                k = 0; // inizializzo l'indice
            }*/    
    }
}


