void mostrar_archivo(char name[])
{
    FILE *archivo;
    archivo= fopen(name, "rb");

    char palabra[6];
    int i=0;

    if(archivo!=NULL)
    {
        while(!feof(archivo))
        {
            fread(palabra, sizeof(palabra), 1, archivo);
            if(!feof(archivo))
            {
                printf("%s\n",palabra);


            }
        }
        fclose(archivo);
    }


    //printf("%i\n",i);

}


void pickpalabra(int pos, char palabra[], char name[])
{

    FILE *archivo;

    archivo=fopen(name,"rb");

    if(archivo!=NULL)
    {
        fseek(archivo, (strlen(palabra) + 1)*(pos-1),SEEK_SET);

        fread(palabra,sizeof(palabra),1,archivo);

        fclose(archivo);
    }

}

int retornarCantidadRegistros(char name[])
{
    char palabra[6];
    int cantidad;
    FILE *archivo;
    archivo=fopen(name,"rb");
    if(archivo!=NULL)
    {
        fseek(archivo,0,SEEK_END);
        cantidad=ftell(archivo)/sizeof(palabra);
        fclose(archivo);
    }
    return cantidad;
}

