int sumar_participacion(char nombre[], char nombre_jugador[])
{
    player jugadorX;
    FILE *archivo;
    archivo= fopen(nombre, "rb");

    if(archivo != NULL)
    {
        while(!feof(archivo))
        {
            fread(&jugadorX, sizeof(player), 1, archivo);

            if(!feof(archivo) && strcmpi(jugadorX.nombre, nombre_jugador)==0)
            {
                jugadorX.cantParticipaciones++;
            }
        }
        fclose(archivo);
    }

    return jugadorX.cantParticipaciones;

}

void cargar_jugador(char nombre[], char player_name[])
{
    player jugadorX;
    FILE *archivo;
    //
    strcpy(jugadorX.nombre, player_name);
    jugadorX.cantParticipaciones=0;
    //
    archivo= fopen(nombre, "ab");
    if (archivo!=NULL)
    {
        fwrite(&jugadorX, sizeof(player), 1, archivo);
        fclose(archivo);
    }
    //
    printf("\nGenial! Jugador creado...");

}

