#include <iostream>
#include <Windows.h>

double* FindMaxPosition(double* A, int num)
{
	double* maxElement = A;
	for (int i = 1; i < num; i++)
		if (A[i] > *maxElement)
			maxElement = &A[i];
	return maxElement;
}

int main()
{
	SetConsoleCP(1251); SetConsoleOutputCP(1251);
	int N1, N2;
	std::cout << "Введите количество элементов двух массивов через пробел:\n";
	std::cin >> N1 >> N2;
	double* A = new double[N1];
	double* D = new double[N2];
	std::cout << "\nВведите через пробел все числа первого массива:\n";
	for (int i = 0; i < N1; i++)
		std::cin >> A[i];
	std::cout << "\nВведите через пробел все числа второго массива:\n";
	for (int i = 0; i < N2; i++)
		std::cin >> D[i];
	double* maxElementA = FindMaxPosition(A, N1);
	double* maxElementD = FindMaxPosition(D, N2);

	int indexA = maxElementA - A,
		indexB = maxElementD - D;

	double sumA = 0, sumD = 0;

	if (indexA <= indexB)
	{
		std::cout << "Максимальный элемент ближе к началу массива в первом массиве.\n";
	}
	else
	{
		std::cout << "Максимальный элемент ближе к началу массива во втором массиве.\n";
	}

	if (sumA < sumD)
		std::cout << "сумма меньше в первом массиве";
	else
		std::cout << "сумма меньше во втором массиве";
	delete[] A;
	delete[] D;
	return 0;
}

