void CountZerosAndPositives(int** matrix, int n, int& zerosCount, int& positivesCount)
{
    zerosCount = 0;
    positivesCount = 0;

    for (int i = 0; i < n; i++)
    {
        for (int j = 0; j < n; j++)
        {
            // Проверяем, принадлежит ли элемент верхней заштрихованной области
            if (i <= j && i + j <= n - 1)
            {
                if (matrix[i][j] == 0)
                {
                    zerosCount++;
                }
            }
            // Проверяем, принадлежит ли элемент нижней области
            else if (i >= j && i + j >= n - 1)
            {
                if (matrix[i][j] > 0)
                {
                    positivesCount++;
                }
            }
        }
    }
}

int main()
{
    SetConsoleCP(1251); SetConsoleOutputCP(1251);
    int n;
