    for (int i = 0; i < n; i++)
    {
        matrix[i] = new int[n];
        for (int j = 0; j < n; j++)
        {
            
            std::cin >> matrix[i][j];
        }
    }

    int zerosCount, positivesCount;
    CountZerosAndPositives(matrix, n, zerosCount, positivesCount);

    std::cout << "Количество нулей в верхней заштрихованной области: " << zerosCount << std::endl;
    std::cout << "Количество положительных элементов в нижней области: " << positivesCount << std::endl;

    // Освобождаем память, выделенную для матрицы
    for (int i = 0; i < n; i++)
    {
        delete[] matrix[i];
    }
    delete[] matrix;

    return 0;
}

