const int N = 1e5;
vector <int> g[N];
int way[N], pos[N], p[N];
vector <vector <int> > lad;

void dfs(int v) {
    if (g[v].size() == 0) {
        way[v] = lad.size();
        lad.push_back({ v });
        return;
    }
    int id = 0, best_len = 0;
    for (auto u : g[v]) {
        dfs(u);
        if (lad[way[u]].size() > best_len) {
            best_len = lad[way[u]].size();
            id = way[u];
        }
    }
    way[v] = id;
    pos[v] = lad[id].size();
    lad[id].push_back(v);
}

void deep(int v, int len, int num) {
    while (v != -1 && len > 0) {
        lad[num].push_back(v);
        v = p[v];
        len--;
    }
}

int go(int v, int len) {
    int u, posd, can;
    while (len > 0 && v != -1) {
        u = way[v];
        posd = pos[v];
        can = (int)lad[u].size() - posd - ONE;
        if (can < len) {
            len -= (can + ONE);
            v = p[lad[u].back()];
        }
        else {
            v = lad[u][posd + len];
            len = 0;
        }
    }
    return max(v, ZERO);
}

void solve() {
    int n, m, i, j;
    cin >> n >> m;
    int x, y, z, a1, a2, a3, a4, ans = 0;
    p[0] = -1;
    for (i = 1; i < n; i++) {
        cin >> p[i];
        g[p[i]].push_back(i);
    }
    dfs(0);
    for (i = 0; i < lad.size(); i++) {
        deep(p[lad[i].back()], lad[i].size() * 3, i);
    }
    cin >> a1 >> a2;
    cin >> x >> y >> z;
    i = go(a1, a2);
    ans += i;
    for (j = 2; j <= m; j++) {
        a3 = (x * a1 + y * a2 + z) % n;
        a4 = (x * a2 + y * a3 + z) % n;
        i = go((a3 + i) % n, a4);
        ans += i;
        a1 = a3;
        a2 = a4;
    }
    cout << ans << endl;
}

